pragma solidity ^0.5.4;

import "../SubscriptionManager.sol";


contract SubscriptionManagerMock is SubscriptionManager {
    uint256 nonce = 0;

    constructor(
        address publisher,
        address wallet
    ) public SubscriptionManager(publisher, wallet) {}

    function create(
        address subscriber,
        address token,
        uint256 amount,
        PeriodUnit periodUnit,
        uint256 periods,
        uint256 maxPeriods,
        uint256 start
    )
        external
    {
        bytes32 hash = keccak256(abi.encodePacked(
            subscriber,
            token,
            amount,
            periodUnit,
            periods,
            maxPeriods,
            start,
            nonce
        ));

        nonce += 1;

        _create(
            hash,
            subscriber,
            token,
            amount,
            periodUnit,
            periods,
            maxPeriods,
            start
        );
    }

    function createWithoutNonce(
        address subscriber,
        address token,
        uint256 amount,
        PeriodUnit periodUnit,
        uint256 periods,
        uint256 maxPeriods,
        uint256 start
    )
        external
    {
        bytes32 hash = keccak256(abi.encodePacked(
            subscriber,
            token,
            amount,
            periodUnit,
            periods,
            maxPeriods,
            start
        ));

        _create(
            hash,
            subscriber,
            token,
            amount,
            periodUnit,
            periods,
            maxPeriods,
            start
        );
    }

}
